import './main.css';
import "animate.css";
import {Navb} from './imports';
import { Fragment } from 'react';
import { Container, Row, Col , Navbar, Nav, Button, Card, Alert, blockquote} from 'react-bootstrap';
function Main() {
  return(
    <Fragment>
      <Navb/>
      <Container fluid className="fadeinleft">
        <br/>
        <Row>
          <Col>
            <div class="jumbotron verticle-center">
              <h1 class="display-1 text-center">6th April - 5th April</h1>
              <figcaption class="blockquote-footer">
                Someone famous in <cite title="Source Title">Source Title</cite>
              </figcaption>
            </div>
            <div class="jumbotron verticle-center">
              <h1 class="display-1 text-center"> hi</h1>
            </div>
            <div class="jumbotron verticle-center">
              <h1 class="display-1 text-center"> hi</h1>
            </div>
          </Col>
        </Row>
        
      </Container>
    </Fragment>
    
  )
}

export default Main;
